import React from 'react';
import './App.css';
import Dialog from './Dialog/Dialog';
import Login from './Login/Login';

function App() {
  let logged = false;
  return (
    <div className="App">
      <header className="App-header"> 
          <Login></Login>      
          <Dialog></Dialog>
      </header>

    </div>
  );
}

export default App;
